CREATE TABLE "CITIES" (
    "ID" NUMBER(18,0) NOT NULL ENABLE,
    "COD" NUMBER(8,0) NOT NULL ENABLE, 
	"DESCRIPTION" VARCHAR2(60 BYTE) NOT NULL ENABLE, 
	"UF" VARCHAR2(3 BYTE) NOT NULL ENABLE, 
	"MUNICIPALITY" NUMBER(8,0), 
	"CALENDAR" NUMBER(4,0), 
	"STATUS" NUMBER(1,0) NOT NULL ENABLE, 
	"IDH" NUMBER(4,3)
);

CREATE UNIQUE INDEX "CITIES_PK" ON "CITIES" ("ID");
CREATE INDEX "CITIES_UFS_IDX" ON "CITIES" ("UF"); 

ALTER TABLE "CITIES" ADD CONSTRAINT "CITIES_PK" PRIMARY KEY ("ID") USING INDEX "CITIES_PK"  ENABLE;
ALTER TABLE "CITIES" ADD CONSTRAINT "CITIES_UFS_FK" FOREIGN KEY ("UF") REFERENCES "UFS" ("UF") ENABLE;

COMMENT ON COLUMN "CITIES"."ID" IS 'ID universal';
COMMENT ON COLUMN "CITIES"."COD" IS 'City code';
COMMENT ON COLUMN "CITIES"."DESCRIPTION" IS 'City ​​name';
COMMENT ON COLUMN "CITIES"."UF" IS 'City unit';
COMMENT ON COLUMN "CITIES"."MUNICIPALITY" IS 'Municipality';
COMMENT ON COLUMN "CITIES"."CALENDAR" IS 'Calendar';
COMMENT ON COLUMN "CITIES"."STATUS" IS 'Status';
COMMENT ON COLUMN "CITIES"."IDH" IS 'Human development index';
COMMENT ON TABLE  "CITIES"  IS 'Cities';

CREATE SEQUENCE CITIES_SEQ
START WITH 1
INCREMENT BY 1
NOCACHE
NOCYCLE;

CREATE OR REPLACE TRIGGER CITIES_ID_TRIGGER
BEFORE INSERT ON CITIES
FOR EACH ROW
BEGIN
    :NEW.ID := CITIES_SEQ.NEXTVAL;
END;

